description:
Birth of the Sun is a 2002 album released by bassist Marcel Jacob. It consists of early recordings of Yngwie J. Malmsteen, and his band Rising Force. Shortly after Birth of the Sun was released, Yngwie released The Genesis, an album featuring most of the same tracks, but with Marcel Jacob's tracks redone.
Track listing

All songs written by Yngwie J. Malmsteen except where indicated.

    &quot;Merlin's Castle&quot;
    &quot;Birth of the Sun&quot;
    &quot;Speed and Action&quot;
    &quot;Dying Man&quot;
    &quot;Suite Opus III&quot;
    &quot;Voodoo Nights&quot;

Personnel

    Yngwie Malmsteen - guitars
    Marcel Jacob - bass
    Zepp Urgard - drums
